 @UberFubarius   easy you say? orbit is completely irrelevant. Give it any engine but cold pressure fed. Give it any attitude control, dynamic or stabilizing. They mentioned it was powerful enough to lift a person? .... It's all insane: There's no way someone (illiterate on top) can build this in a day... hell not even in a month, unless they were very capable, driven, already knowledgeable, and exceedingly lucky...
- My point is: Rolling for that is insane: no matter the amount of success, you cannot make it...
- What am I gonna roll for next? building a fusion reactor? - Yes, let's get single success on building a fusion reactor, what is it gonna be? It will work but cost more power to run than it generates? That's still insane...

